 eller anden form for mad/snack\\nDe er det perfekte makkerpar.\\n\\nEn dag beslutter hun sig for at blive en del af det brændende svær i håb om at finde ud af hvorfor [[Osty]] forsvandt - ingen ved hvordan dette kommer til at ende.logseq____&quot;,536870972]],[logseq____&quot;^15logseq____&quot;,[994,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^1@logseq____&quot;,536870972]],[logseq____&quot;^15logseq____&quot;,[994,logseq____&quot;^Flogseq____&quot;,995,536870972]],[logseq____&quot;^15logseq____&quot;,[994,logseq____&quot;^Xlogseq____&quot;,311,536870972]],[logseq____&quot;^15logseq____&quot;,[994,logseq____&quot;^Vlogseq____&quot;,311,536870972]],[logseq____&quot;^15logseq____&quot;,[994,logseq____&quot;^Ulogseq____&quot;,311,536870972]],[logseq____&quot;^15logseq____&quot;,[994,logseq____&quot;^Ulogseq____&quot;,312,536870972]],[logseq____&quot;^15logseq____&quot;,[994,logseq____&quot;^Ulogseq____&quot;,453,536870972]],[logseq____&quot;^15logseq____&quot;,[994,logseq____&quot;^?logseq____&quot;,[logseq____&quot;^ logseq____&quot;,logseq____&quot;^3Elogseq____&quot;,3],536870972]],[logseq____&quot;^15logseq____&quot;,[994,logseq____&quot;^Jlogseq____&quot;,[],536870972]],[logseq____&quot;^15logseq____&quot;,[994,logseq____&quot;^Hlogseq____&quot;,312,536870972]],[logseq____&quot;^15logseq____&quot;,[994,logseq____&quot;^Hlogseq____&quot;,453,536870972]],[logseq____&quot;^15logseq____&quot;,[994,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u66745d75-ef96-47e5-a32c-6efef7cc7017logseq____&quot;,536870972]],[logseq____&quot;^15logseq____&quot;,[995,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;id:: 64ecc549-1aee-4b82-a4c3-450d2275988d\\npage-type:: [[Character]]\\ntemplate-type:: ((650aa714-faaa-462c-a70a-efeb8f2b8952))\\ncharacter-type:: player-character, NPC\\ncharacter-player:: Tobhias\\nalive:: true\\nrace:: [[Wood-Elf]]\\naffiliation:: [[The Burning Sword]]\\nrank:: General\\n\\nlogseq____&quot;,536870972]],[logseq____&quot;^15logseq____&quot; ng så længe han er der, og så snart han er væk kan alting gå galt alligevel. Uanset hvor mange banditter han slår ihjel kommer der bare flere så længe lederen som sidder hjemme i skjulet stadig er i live. \\nDerfor har han besluttet sig for at vende tilbage til sine evner som spion/agent og forhåbentligt gøre en forskel ved at gå efter mere strategiske mål som har indflydelse. Folk som korrupte politikere, bandit ledere og deslige\\n\\nSit kaldenavn \\logseq____&quot;[[Lark]]\\logseq____&quot; fik han som barn som kodenavn hos sin kontakt fordi han var god til at imitere fuglelyde/sang og holdt til i skovenlogseq____&quot;,536871035]],[logseq____&quot;^15logseq____&quot;,[1316,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^1@logseq____&quot;,536871035]],[logseq____&quot;^15logseq____&quot;,[1316,logseq____&quot;^Flogseq____&quot;,1322,536871035]],[logseq____&quot;^15logseq____&quot;,[1316,logseq____&quot;^Xlogseq____&quot;,19,536871035]],[logseq____&quot;^15logseq____&quot;,[1316,logseq____&quot;^Vlogseq____&quot;,19,536871035]],[logseq____&quot;^15logseq____&quot;,[1316,logseq____&quot;^Ulogseq____&quot;,19,536871035]],[logseq____&quot;^15logseq____&quot;,[1316,logseq____&quot;^?logseq____&quot;,[logseq____&quot;^ logseq____&quot;,logseq____&quot;^3Elogseq____&quot;,3],536871035]],[logseq____&quot;^15logseq____&quot;,[1316,logseq____&quot;^Jlogseq____&quot;,[],536871035]],[logseq____&quot;^15logseq____&quot;,[1316,logseq____&quot;^Hlogseq____&quot;,19,536871035]],[logseq____&quot;^15logseq____&quot;,[1316,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u66745d76-36af-41b2-a466-b83b619801cclogseq____&quot;,536871035]],[logseq____&quot;^15logseq____&quot;,[1317,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;logseq____&quot;,536871035]],[logseq____&quot;^15logseq____&quot;,[1317,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^1@logseq____&quot;,536871035]],[logseq____&quot;^15logseq____&quot;,[1317,logseq____&quot;^Flogseq____&quot;,1316,536871035]],[  <script type="text/javascript">// Single Page Apps for GitHub Pages

      // This script checks to see if a redirect is present in the query string
      // and converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function(l) {
        if (l.search) {
          var q = {};
          l.search.slice(1).split('&').forEach(function(v) {
            var a = v.split('=');
            q[a[0]] = a.slice(1).join('=').replace(/~and~/g, '&');
          });
          if (q.p !== undefined) {
            window.history.replaceState(null, null,
              l.pathname.slice(0, -1) + (q.p || '') +
              (q.q ? ('?' + q.q) : '') +
              l.hash
            );
          }
        }
      }(window.location))</script>
